VALUES (118, 'Pražské jaro 2016', '2016-05-12 16:00:00.000000', '2016-06-05 02:00:00.000000', '[33, 62, 544]', 'en', 'Máte-li rádi klasickou hudbu, jazz a world music v prvotřídním podání, navíc umocněné unikátními koncertními prostorami, pak by vám neměl uniknout 71. ročník Mezinárodního hudebního festivalu Pražské jaro. Nejstarší, nejznámější a co do počtu koncertů nejrozsáhlejší hudební festival v České republice nabídne v roce 2016 skvělý mix tradice a experimentu.

Jubileum 1946 – 2016 připomene zahajovací koncert festivalu ve čtvrtek 12. května ve Smetanově síni Obecního domu v Praze. Tradiční Má vlast Bedřicha Smetany se rozezní pod taktovkou estonského dirigenta Paava Järviho v podání České filharmonie, která stála v roce 1946 u zrodu festivalu.

Páteř programu tvoří tradičně velká jména světové hudební scény a špičkové orchestry: Daniel Barenboim & Staatskapelle Berlin, Gil Shaham & Singapore Symphony Orchestra, Maurizio Pollini, Andreas Scholl & Collegium 1704, Murray Perahia & Academy of St Martin in the Fields, Sakari Oramo & BBC Symphony Orchestra, New London Consort ad.

Pobaltský a španělský akcent
Specialitou ročníku 2016 je akcent na hudbu pobaltských národů a úvod do tříletého cyklu zaměřeného na hudební produkci Španělska a Latinské Ameriky. Přijedou vynikající zástupci těchto regionů. Z Pobaltí jsou to sesterské duo Baiba & Lauma Skride, mezzosopranistka Violeta Urmana, Litevský národní symfonický orchestr, Kaunas State Choir a Čiurlionis Quartet, kteří přivezou hudbu této umělecky unikátní oblasti.

Jste-li spíše příznivcem temperamentního jihu, pak si nenechte ujít španělskou řadu, která představí barokní skladby španělských a italských autorů objevené v Jižní a Střední Americe v podání cenami ověnčeného Al Ayre Español a sopranistky Raquel Anduezy, strhující putování staletími až k samotným kořenům tradičního flamenca s taneční legendou La Lupi, Antoniem Canalesem, zpěvákem Gabrielem de la Tomasou a dalšími v projektu RETOrno a klavíristu Javiera Perianese, který se představí mimo jiné ve Fallových Nocích ve španělských zahradách, za jejichž nahrávku získal v roce 2012 nominaci na Latin Grammy.

Unikáty Pražského jara 2016
Diváci milující exotiku se mohou těšit na dvě hodiny výjimečné podívané, kterou nabídne Shanghai Kunqu Opera Troupe. Ta se v roce 2014 stala vítězem celostátní čínské soutěže v interpretaci tradiční opery Kunqu. Festival představí čerstvého vítěze Mezinárodní klavírní soutěže Fryderyka Chopina 2015 ve Varšavě, jihokorejského klavíristu Seong-Jin Choa. Skutečnou lahůdku pak nabídne všem milovníkům jazzu: osmnáctiletého kytaristu Andrease Varádyho, kterého označil vizionář Quincy Jones za jednoho z nejtalentovanějších lidí této planety. Pražské jaro uvede 30. května jeho pražský debut v unikátních prostorách Fora Karlín.

Pocta Karlu IV.
Ani Pražské jaro nezapomíná na významné 700. výročí narození Karla IV. v roce 2016. 18. května rozezní zdi Anežského kláštera hudba doby Karla IV. v podání souboru Tiburtina Ensemble. O den později na tento projekt naváže vynikající belgický ansámbl Graindelavoix, který přiváží unikátní program z oblasti Kypru 15. století.

Debut Pražského jara 2016
Debut Pražského jara 2016 svěřil festival taktovce mladého českého dirigenta Jiřího Rožně, finalisty Nestlé and Salzburg Festival Young Conductors Award 2015 a Donatella Flick LSO Conducting Competition 2014. Sekundovat mu bude skvělý, teprve osmnáctiletý, jihokorejský flétnista Yubeen Kim, vítěz soutěže Pražského jara 2015 a laureát Geneva Competition 2014.

Proměny romantismu
Pro příznivce komorní hudby připravilo Pražské jaro třetí ročník Víkendu komorní hudby tentokráte s tématem „Proměny romantismu“. Představí se sólistka Curyšské opery Martina Janková s klavíristou Gérardem Wyssem, Guarneri Trio Prague, první klarinetista Bostonských symfoniků Thomas Martin, harfistka Kateřina Englichová, fama Q, houslista Ivan Ženatý, Armida Quartett - vítěz ARD International Competition 2012 a další. Diváci se mohou opět těšit na nevšední a velmi krásná místa koncertů, mimo jiné na Dvořákovu a Sukovu síň Rudolfina, sál Novoměstské radnice, Lichtenštejnský palác, Anežský klášter a další.

Diváci se mohou opět těšit na nevšední a velmi krásná místa koncertů.

Informace o programu a nákup vstupenek on-line. Zahájení prodeje vstupenek
11.12.2015 v 10.00 hodin. Vstupenky budou k dispozici v pokladně Pražského jara v Rudolfinu (Po - Pá 10:00 - 18:00 kromě svátků) a v prodejních místech Pražského jara po celé České republice.',
             0, '{}', 100, 50.0755381, 14.4378005, FALSE, NULL, 0, '{}', NULL, '2016-04-30 04:06:09.618545', 0, 0, NULL,
        NULL, NULL, NULL,
        '55 koncertů klasické hudby v 17 koncertních sálech Prahy nabídne 71. ročník Mezinárodního hudebního festivalu Pražské jaro od 12. května do 4. června 2016. Praha přivítá na 98 orchestrů, komorních ansámblů a sólistů z 23 zemí světa.',
        96);
