  (119, 'Zodiacon 2016', '2016-05-26 20:00:00.000000', '2016-05-29 20:00:00.000000', '[315]', 'en', NULL, 0, '{}', 141,
        49.8061669, 15.7314469, FALSE, NULL, 0, '{}', NULL, '2016-04-30 04:22:24.928367', 0, 0, NULL, NULL, NULL, NULL, 'Zveme vás na ZodiaCon 2016 - již šestý ročník mezinárodního setkání furries, tedy lidí, kteří se nějakým způsobem cítí být spjati se zvířaty.

Název ZodiaCon je odkazem na zvěrokruh, nebo chcete-li zvířetník. Stejně jako ve zvěrokruhu, i na našem conu potkáte všemožnou havěť - vítán je kdokoliv bez ohledu na živočišný druh, velikost, barvu srsti, pohlaví nebo sexuální orientaci.',
   4);
