  (120, 'Soumraky 2016', '2016-06-10 16:00:00.000000', '2016-06-12 18:00:00.000000', '[73, 5, 42, 80, 196]', 'en', NULL,
        0, '{}', 142, 49.567810863342494, 17.41230010986328, FALSE, NULL, 0, '{"noImage": true}', NULL,
                                          '2016-04-30 19:21:21.810787', 0, 0, NULL, NULL, NULL, NULL, 'Soumrak je fantasy hra. Bitva (tedy tak zvaná dřevárna) s výraznými prvky role-playingu (také LARPová bitva), inspirovaná známou počítačovou hrou Warcraft: Orcs and Humans. Hra byla vytvořena především pro nováčky a mladší hráče od 12 let. Rádi ale uvidíme i ostřílené hráče a to nejlépe v řadách speciálních postav.

Budeme se na Vás těšit, až nastane Soumrak… již podesáté!', 140);
