VALUES
  (124, 'Chuť Itálie', '2016-05-21 16:00:00.000000', '2016-05-21 17:30:00.000000', '[110, 29, 155, 243]', 'en', NULL, 0,
        '{}', 146, 50.21112382359837, 15.832283198833466, FALSE, NULL, 0, '{"noImage": true}', NULL,
                                      '2016-05-01 02:55:25.278952', 0, 0, NULL, NULL, NULL, NULL, 'Přijďte si vychutnat atmosféru slunné Itálie. Ochutnáte tradiční italské speciality (uzeniny, sýry těstoviny a pod.) a k tomu si vychutnáte sklenku výborného vína. Všechny produkty budete moci také zakoupit. Pro zpříjemnění dne je pro Vás také připraveno hudební vystoupení a gastronomická show. Tento italský den budete moci zakončit zhlédnutím filmu Velká nádhera (La Grande Bellezza) italského režiséra Paola Sorrentina. Cenami ověnčený snímek získal například Zlatý glóbus za nejlepší cizojazyčný film.
: "Akce je pořádána pod záštitou náměstkyně primátora města Hradec Králové pro oblast sociálních věcí, zdravotnictví, kultury a cestovního ruchu, paní Ing. Annou Maclovou."

Kontakt: www.butterfly-agency.cz, www.butterfly-aid.cz

Cena: 100 Kč', 1);
