  (125, 'Klášterní hudební slavnosti', '2016-06-27 01:00:00.000000', '2016-07-11 03:00:00.000000', '[544, 172, 123]',
        'en',
        'Tradiční letní festival klasické hudby v Šumperku a okolí. Koncerty předních českých umělců, ale i zahraničních hostů. Houslistka a patronka festivalu Gabriela Demeterová, sopranistka Eva Urbanová, houslista Pavel Šporcl a mnoho dalších. Šumperk, Velké Losiny, Karlova Studánka, Králíky, Krnov, Jeseník, Loučná nad Desnou a Bludov. Ve všech těchto městech se začátkem léta rozezní klasické nástroje a zpěv a vy si tak můžete dopřát krásné hudební zážitky.',
        0, '{}', 148, 49.96528689655232, 16.972739696502686, FALSE, NULL, 0, '{"organizer": "Roman Janků"}', NULL,
                                         '2016-05-05 01:21:34.406147', 0, 0, NULL, NULL, NULL, NULL,
   'Festival klasické hudby v Šumperku a okolí.', 139);
