  (126, 'Gothic medailon', '2016-07-28 16:00:00.000000', '2016-07-31 18:00:00.000000', '[5, 80]', 'en', NULL, 0, '{}',
        129, 49.757245, 17.3860322, FALSE, NULL, 0, '{}', NULL, '2016-05-12 08:05:14.423298', 0, 0, NULL, NULL, NULL,
   NULL,
   'Gothic Medailon je klasický fantasy larp-svět, inspirovaný RPG sérií Gothic. Hra se vyznačuje především volnými hráčskými postavami, několika rozličnými příběhovými liniemi a důrazem na herní atmosféru. Snažíme se vytvořit zajímavý a co nejrealističtější herní svět, plný originálních úkolů, poutavých legend, opravdových rekvizit a surovin a nevšedních zážitků.',
   1);
