VALUES (182, 'HUMR', '2016-05-19 02:00:00.000000', '2016-05-19 03:59:00.000000', '[355]', 'en', NULL, 0, '{}', 179,
             50.53663075777064, 14.128890037536621, FALSE, NULL, 0, '{"noImage": true}', NULL,
                                '2016-05-17 19:42:09.061561', 0, 0, NULL, NULL, NULL, NULL,
        'ČeskyVelká Británie, Francie, Nizozemsko, 2015, 119 min.Snímek Humr je romantickým filmem, jehož děj se odehrává v blízké budoucnosti, kdy jsou dle zákonů Města nezadaní lidé zatýkání a odváženi do Hotelu. Tam si musejí do 45 dní najít odpovídajícího partnera. Pokud se jim to nepodaří, jsou proměněni ve zvíře dle vlastního výběru a vypuštěni do Lesa. Zoufalému muži se podaří uprchnout z Hotelu do Lesa, kde žijí Samotáři, a zamiluje se tam, ovšem něco takového je proti jejich zásadám',
        146);
