  (93, 'Precedens', '2016-04-20 01:00:00.000000', '2016-04-20 02:30:00.000000', '[28, 123]', 'en', NULL, 0, '{}', 136,
       50.2111512877168, 15.831132531166077, FALSE, NULL, 0, '{"noImage": true}', NULL, '2016-04-16 00:30:40.885140', 0,
                         0, NULL, NULL, NULL, NULL, 'Česká rocková hudební skupina Precedens vznikla v roce 1982. Vedoucím a autorem hudby je Martin Němec. Výraznou postavou této skupiny se stala Bára Basiková. Za mikrofonem jí také zastoupili zpěváci Vladimír Dvořák, Jana Benetová nebo Petr Kolář.

Legendární kapela Precedens právě přichází ve výrazně omlazené sestavě špičkových hudebníků s ambiciózním koncertním projektem, kterému vévodí fenomenální hlas hradecké rodačky Ivy Marešové. Na koncertě zazní původní skladby i novinky v energickém a jedinečném podání. Uslyšíte tak nezapomenutelné hity jako Souměrná, Eloise nebo Soumrak bohů.
Obsazení:
Iva Marešová - zpěv
Jan Šobr - kytara
Martin Němec - klávesy
Martin Ivan - basová kytara
Pavel Nedoma - klávesy
Radek Doležal - bicí
Kontakt: www.butterfly-agency.cz, www.butterfly-aid.cz

Cena: 340 Kč', 1);
