VALUES (127, 'Food festival Zábřeh', '2016-05-14 16:00:00.000000', '2016-05-15 00:00:00.000000', '[29, 62, 33]', 'en', 'Festival se bude konat za účasti profesionálních i amatérských ,,kuchtíků", kteří vám připraví to nejlepší ze street foodu (palačinky, grilované sýry, hamburgery, reuben, paella, sushi, veganské polévky, raw strava...). Vedle této nabídky se můžete těšit i na zahraniční kuchyni: japonskou, španělskou, řeckou, italskou, gruzínskou, vietnamskou, mexickou.... Kromě chutného jídla plánujeme i doprovodný program. Dětský koutek, kde si například děti budou moci usmažit vlastní skvělé palačinky nebo udělat domácí čokoládu.
Součástí budou i přednášky o zdravé stravě a workshopy s ukázkami vaření specialit mezinárodní kuchyně.
Atmosféru celého dne doprovodí hudební program.
Zažijte město jinak. Přijďte ochutnat kvalitní jídlo, které se bude připravovat přímo na ulici.
Těšit se můžete na „profesionály“, kteří budou vařit přímo před zraky návštěvníků, ale i sousedy, kteří ukuchtí své vlastní dobroty.
Nebude chybět ani studená kuchyně - sirupy, sýry, čokoláda, francouzské víno, marmelády nebo domácí zavařeniny.
Všechny účastníky budeme postupně zveřejňovat.
Těšíme se na vás.', 0, '{}', 151, 49.882008953089574, 16.872194409370422, FALSE, NULL, 0, '{}', NULL,
                                                      '2016-05-12 08:40:40.847910', 0, 0, NULL, NULL, NULL, NULL,
        'Co se takhle v Zábřehu dobře najíst? Čerstvě, kvalitně, z lokálních surovin a poctivě? Ochutnat speciality mezinárodní kuhyně, lokální dobroty nebo se podívat na gastroshow výborných kuchařů - a u toho se hlavně dobře bavit! To vše nabízí street food festival, který připravujeme v Zábřehu v sobotu 14. května na ulici Farní a v prostoru pod zámkem - u Kapří fontánky...',
        1);
