  (168, 'Na Stojáka live!', '2016-05-18 00:00:00.000000', '2016-05-18 04:30:00.000000', '[257, 355, 7]', 'en', NULL, 0,
        '{}', 112, 48.9756578, 14.4802549999999, FALSE, NULL, 0, '{"noImage": true}', NULL,
                               '2016-05-17 18:47:59.306435', 0, 0, NULL, NULL, NULL, NULL,
   'Stand up comedy-sólové výstupy bavičů, specialita angloamerických barů, je ultimátním testem komiků. Kdo nedokáže, aby divák zvedl oči od sklenky, natož odložil doutník a zaplácal, je vyřízen. Originální česká "stand-up comedy" vychází z tradice známé z angloamerických barů. V nich se bavič na malém pódiu postaví před publikum a během několika minut je baví svými výstupy.',
   146);
