VALUES (176, 'Závěrečná show taneční skupiny JUST US', '2016-06-19 22:00:00.000000', '2016-06-20 04:00:00.000000',
             '[568, 67]', 'en', NULL, 0, '{}', 110, 49.593778, 17.2508786999999, FALSE, NULL, 0, '{}', NULL,
                                                               '2016-05-17 19:31:23.703738', 0, 0, NULL, NULL, NULL,
        NULL, 'Srdečně Vás zveme na zakončení velice úspěšné sezóny tanečního studia JUST US.
Těšit se můžete na soutěžní formace, se kterými naši tanečníci dosáhli nemálo úspěchů, dále speciální show, které jsme si pro Vás připravili přímo na závěrečnou show a také vystoupení našich lektorů a rodičovské složky. Můžete se těšit na naše všechny pobočky – Olomouc, Zlín, Ostrava, Opava.

Závěrečná show se bude konat v neděli 19.6. 2016 v příjemných prostorách Sklubu (tř.17 listopadu 43
Olomouc).
Celá show vypukne v 16,00!!

Vstupné je 100,- a pro děti do 6ti let zdarma, vstupenky budou v prodeji na místě.', 141);
