VALUES (188, 'Neurofunk will never DIE! AGRESSOR BUNX', '2016-07-09 03:00:00.000000', '2016-07-09 12:00:00.000000',
             '[348, 568, 106, 62]', 'en', NULL, 0, '{}', 100, 50.0755381, 14.4378005, FALSE, NULL, 0, '{}', NULL,
                                                                          '2016-05-18 23:39:35.849650', 0, 0, NULL,
        NULL, NULL, NULL, 'Po úspěšném květnovém díle s Eatbrain crew, jsme si pro vás připravili jednu speciální letní lahůdku. Stejně jako minulý rok, tak i tentokrát nás čeká červencový speciál.
Kompletní CZ line-up se odehraje v B2B setech, které postupně prozradíme. Na grill jsme pozvali pěkně krvavou porci neurofunku, ukrajinský projekt AGRESSOR BUNX!
Po opravdu dlouhém domlouvání se nám také podařilo pozvat kamaráda DJ PIXIE, který se na vás vyřádí v čistě pure neurofunk setu!',
        141);
